import { useState } from "react";

function MessageType9() {
  const [formData, setFormData] = useState({
    preamble: "53",
    t0: "",
    ura: "",
    xg: "",
    yg: "",
    zg: "",
    xg_rate: "",
    yg_rate: "",
    zg_rate: "",
    xg_acc: "",
    yg_acc: "",
    zg_acc: "",
    agf0: "",
    agf1: ""
  });
  const [result, setResult] = useState(null);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handlePreambleChange = (preambleValue) => {
    setFormData({ ...formData, preamble: preambleValue });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://127.0.0.1:5000/api/numbers/9", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });
      const data = await res.json();
      setResult(data.hex_string || data.error);
    } catch (err) {
      setResult("Network error. Check backend.");
    }
  };

  return (
    <div className="container d-flex justify-content-center align-items-center min-vh-100">
      <div className="card p-4 shadow-lg w-75">
        <h1 className="text-center mb-4">Message Type 9 (GEO Navigation)</h1>
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Select Preamble:</label>
            <div className="d-flex gap-2">
              <button type="button" className={`btn ${formData.preamble === "53" ? "btn-primary" : "btn-outline-primary"}`} onClick={() => handlePreambleChange("53")}>53</button>
              <button type="button" className={`btn ${formData.preamble === "9A" ? "btn-primary" : "btn-outline-primary"}`} onClick={() => handlePreambleChange("9A")}>9A</button>
              <button type="button" className={`btn ${formData.preamble === "C6" ? "btn-primary" : "btn-outline-primary"}`} onClick={() => handlePreambleChange("C6")}>C6</button>
            </div>
          </div>

          <div className="row g-2 mb-3">
            <div className="col-4"><input className="form-control" name="t0" type="number" min="0" max="86384" placeholder="t0 (seconds)" value={formData.t0} onChange={handleChange} required /></div>
            <div className="col-4"><input className="form-control" name="ura" type="number" min="0" max="15" placeholder="URA (0-15)" value={formData.ura} onChange={handleChange} required /></div>
          </div>

          <h6>ECEF Position (m)</h6>
          <div className="row g-2 mb-3">
            <div className="col"><input className="form-control" name="xg" type="number" placeholder="XG" value={formData.xg} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="yg" type="number" placeholder="YG" value={formData.yg} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="zg" type="number" placeholder="ZG" value={formData.zg} onChange={handleChange} required /></div>
          </div>

          <h6>Velocity (m/s)</h6>
          <div className="row g-2 mb-3">
            <div className="col"><input className="form-control" name="xg_rate" type="number" step="any" placeholder="XG rate" value={formData.xg_rate} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="yg_rate" type="number" step="any" placeholder="YG rate" value={formData.yg_rate} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="zg_rate" type="number" step="any" placeholder="ZG rate" value={formData.zg_rate} onChange={handleChange} required /></div>
          </div>

          <h6>Acceleration (m/s^2)</h6>
          <div className="row g-2 mb-3">
            <div className="col"><input className="form-control" name="xg_acc" type="number" step="any" placeholder="XG acc" value={formData.xg_acc} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="yg_acc" type="number" step="any" placeholder="YG acc" value={formData.yg_acc} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="zg_acc" type="number" step="any" placeholder="ZG acc" value={formData.zg_acc} onChange={handleChange} required /></div>
          </div>

          <h6>Clock Terms</h6>
          <div className="row g-2 mb-3">
            <div className="col"><input className="form-control" name="agf0" type="number" step="any" placeholder="aGf0 (s)" value={formData.agf0} onChange={handleChange} required /></div>
            <div className="col"><input className="form-control" name="agf1" type="number" step="any" placeholder="aGf1 (s/s)" value={formData.agf1} onChange={handleChange} required /></div>
          </div>

          <button type="submit" className="btn btn-primary w-100">Submit</button>
        </form>

        {result && (
          <div className="mt-4 p-3 bg-light border rounded">
            <p className="mb-0">{result}</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default MessageType9;
